import React from 'react';
import ReactDOM from 'react-dom';

import './index.css';

import LoginHeaderContent from './components/login/LoginHeader'
import LoginForm from './components/login/LoginForm'
import navbarLeft from './components/UI/navbarLeft'

ReactDOM.render(<LoginHeaderContent />,document.getElementById('login-header'));
ReactDOM.render(<LoginForm />,document.getElementById('login-form'));
ReactDOM.render(<navbarLeft />,document.getElementById('uiLeftNavbar'));
